import React from 'react';
import { getThemeProps } from '@material-ui/styles';

function DraggableColorBox(props){
    return(
        <div style={{ backgroundColor: props.color}}>
            {getThemeProps.color}
        </div>
    );
}
export default DraggableColorBox;
